  - uid: 2598
    components:
    - name: The Singuloosing Guide For Idiots
      type: MetaData
    - rot: 0.0014537983079208061 rad
      pos: -18.582325,-40.732265
      parent: 2
      type: Transform
    - stampState: paper_stamp-centcom
      stampedBy:
      - CentCom
      content: >2-

                                     /  |    |   |\\   \\        |   |
                                   /    |    |   |  \\   \\      |   |
                                               |   |    \\   \\    |   |
                                               |   |      \\   \\  |   |    |   \\
                                               |   |        \\   \\|   |    |     \\

                        The definitive guide to creating your very own...
                                    GRAVITATIONAL SINGULARITY!!!!
        =================================================


        1: Put on a hardsuit.


        2: Grab wire and materials


        3: Locate the emitter, radiation, PA, and containment field crates


        4: place the containment field crates in a 9x9 square, 4 in the corners, 4 on the sides of the square.


        5: Place the radiation collectors to the sides of the containment area.


        6: Place one or two emitters facing each CORNER containment field.


        7: wire up the radiation generators to HV cable and an SMES or powers source, wire up the emitters to an MV cable and a substation.


        8: Begin constructing the PA, this is done by creating a T shape of certain machines.


        (Facing it from behind, as it was a T.)

        * End cap on the bottom of the T.

        * Fuel chamber above that.

        * Power box above that, with an HV cable below it.

        * Port emitter on the right, starboard emitter on the left.

        * Controller computer on the right of the fuel chamber.


        9: Check the PA control computer to see if it is complete.


        10: After making sure everything is in working order, enable every containment field, emitter, and radiation collector, making sure they all turn on correctly.


        11: Enable the PA, set it to power level 1.

           Congratulations! You have made your very own singularity!


        ================================================


        *NanCo. is not responsible for any tumours, spacings, or destroyed property due to any incompetency or malicious intentions with gravitational singularities.
      type: Paper
