    components:
    - name: cryogenics brief
      type: MetaData
    - pos: 19.32648,20.608814
      parent: 2
      type: Transform
    - stampState: paper_stamp-centcom
      stampedBy:
      - CentCom
      content: >-
        --- Cryogenics brief ---


        1. Set the freezer to 100K and make sure it is on.

        2. Set the filters to filter out waste gases and turn both of them on. (Carbon Dioxide, Nitrous Oxide)

        3. Attach an air canister to the connector port with a wrench. Make sure input pump is set to ~80 kPa and turn it on. (Overpressurizing the pod will result in harm the occupant)

        4. Use the gas analyzer on the cryo pod(s) to make sure it is at a safe pressure (around 101 kPa) and that the temperature is around 100K.

        5. The pod is now ready for patients. 


        6. Make sure patients are not wearing insulative clothing when entering, as it will impede the healing process.

        7. Have the occupant enter the pod (either voluntarily or drag them in).

        8. Put a container in the pod with whatever drug(s) you are going to administer to the patient. The drugs will gradually enter their bloodstream until the beaker runs out.


        To remain frugal with your medicines, it is advised that you calculate the amount you want to heal and how much drug to administer *before* placing the drug mixture in the pod. You may find out you wasted 100u of cryoxadone when you could have used only 50u.


        --- Monitoring cryogenics patients ---


        * The pod has a built-in health analyzer, you can use it to monitor the status of the occupant.


        * If the patient is taking brute damage, it is a result of improper pressure. Take the occupant out immediately and use a gas analyzer on the pod to diagnose the problem and adjust pressure accordingly.
        	   - To raise pressure in the pod, increase the pump pressure. It takes less than a minute for the new pressure to normalize in the pod, so be cautious not to overpressure.
        	   - To lower pressure in the pod, turn off the gas pump and use the waste gas filters to evacuate oxygen and nitrogen. Make sure the gas pump is at a safe pressure, then turn it on again.

        * If the patient is taking burn damage, they have spent too long in the pod. Take the occupant out immediately and ensure they warm up.
      type: Paper
